webpackJsonp([33725536549890],{468:function(e,a){e.exports={data:{markdownRemark:{html:'<p><img src="/5d5d9eefa31e5e13a6610d9fa7a283bb.svg"></p>\n<p>I’ve been doing lots of work in React and React Native lately. I put on a workshop through ACM@KU this week to share some of the knowledge I’ve gained using these frameworks.</p>\n<p><a href="https://github.com/e-nichols/KU-ACM-Learning-React">Here’s a link to the Github repo.</a>. The presentation slides are in the “slides” folder. It covers the basics: declarative vs. imperative programming, components, props, state, render(), and a bunch of examples. Enjoy!</p>',timeToRead:1,tableOfContents:"",fields:{tagSlugs:["/tags/ku-acm/","/tags/react/","/tags/workshop/"]},frontmatter:{title:"KU ACM React Workshop",tags:["KU ACM","React","workshop"],date:"February 08, 2017",author:{id:"Evan Nichols",bio:"Software Engineer and outdoor enthusiast. EngRes @ Google NYC.",avatar:{children:[{responsiveResolution:{src:"/static/4c8a15d8009c77284919b7aa2785b3cc-88e85.jpg",srcSet:"/static/4c8a15d8009c77284919b7aa2785b3cc-88e85.jpg 1x,\n/static/4c8a15d8009c77284919b7aa2785b3cc-db17a.jpg 1.5x,\n/static/4c8a15d8009c77284919b7aa2785b3cc-599b9.jpg 2x,\n/static/4c8a15d8009c77284919b7aa2785b3cc-3e248.jpg 3x"}}]}}}}},pathContext:{slug:"/ku-acm-react-workshop/"}}}});
